sys_variable_value.value:
(function execute(inputs, outputs) {
      var responseBody = new global.JSON().decode(inputs['responseBody']);  

        if(inputs.statusCode == '200' || inputs.statusCode == '201' ) {
             outputs.successful = true;
      } else {
             outputs.successful = false;
             gs.error("Error while retreaving entity information. Response Received:" + responseBody);  
      }

})(inputs, outputs);

